             "content_value":"<div> <label htmlFor=\"\">VISION</label> <p>Empower Filipinos to achieve life’s fullest potential without the need to work abroad.</p> </div> <div> <label htmlFor=\"\">MISSION</label> <p>We are transforming the Philippine workplace and with sustainable global careers in amazing, close to home, working environments by delivering best-in-class technology and customized talent-driven solutions for international businesses.</p> </div> <div> <label htmlFor=\"\">VALUES</label> <ul> <li>Talent-driven</li> <li>Client-Centric</li> <li>Transparency</li> <li>Flexibility</li> <li>Partnerships</li> </ul> </div>",
